import os
import uuid
from flask import Flask, request, send_file
from wand.image import Image
from werkzeug.utils import secure_filename

UPLOAD_FOLDER = './uploads/'
CONVERTED_FOLDER = './converted/'
ALLOWED_EXTENSIONS = {'jpg', 'jpeg', 'png'}

app = Flask(__name__)
app.config['UPLOAD_FOLDER'] = UPLOAD_FOLDER
app.config['CONVERTED_FOLDER'] = CONVERTED_FOLDER


def allowed_file(filename):
    return '.' in filename and \
        filename.rsplit('.', 1)[1] in ALLOWED_EXTENSIONS


@app.route('/', methods=['GET', 'POST'])
def upload_file():
    if request.method == 'POST':
        file = request.files['file']
        if file and allowed_file(file.filename):
            filename = secure_filename(file.filename)
            file.save(os.path.join(app.config['UPLOAD_FOLDER'], filename))
            with Image(filename=os.path.join(app.config['UPLOAD_FOLDER'], filename)) as img:
                img.flip()
                img.flop()
                file_id = str(uuid.uuid4()) + '.png'
                img.save(filename=os.path.join(app.config['CONVERTED_FOLDER'], file_id))
                ret_file = os.path.join(app.config['CONVERTED_FOLDER'], file_id)
            return send_file(ret_file, as_attachment=True)

    return '''
    <!doctype html>
    <head>
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0-alpha1/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-GLhlTQ8iRABdZLl6O3oVMWSktQOp6b7In1Zl3/Jr59b6EGGoI1aFkw7cmDA6j6gD" crossorigin="anonymous">
        <title>Flipflop your Image</title>
</head>
<body>
<div class="container mt-4" >
    <h1>FlipFlop your Image!</h1>
    <br/>
    <img src="data:image/jpeg;base64, " />
    <br/><br/>
    <p>This awesome service flipflops your image!</p>
    <form action="" method=post enctype=multipart/form-data>
        <p><input type=file name=file>
        <input type=submit value=Upload></p>
    </form>
</div>
</body>
    '''

if __name__ == "__main__":
    app.run(host="0.0.0.0", port=8080)
